<?php

namespace pagopa\methods\objects;

use pagopa\crawler\methods\object\RT;
use PHPUnit\Framework\Attributes\TestDox;
use PHPUnit\Framework\TestCase;

class RTTest extends TestCase
{

    protected RT $instance_1_versamento;

    protected RT $instance_2_versamento;


    protected RT $instance_1_2_bollo;


    protected function setUp(): void
    {
        $this->instance_1_versamento = new RT(base64_decode(''));
        $this->instance_2_versamento = new RT(base64_decode(''));
        $this->instance_1_2_bollo = new RT(base64_decode(''));
    }

    #[TestDox('getImportoVersamento()')]
    public function testGetImportoVersamento()
    {
        $this->assertEquals('16.00', $this->instance_1_versamento->getImportoVersamento(0));
        $this->assertNull($this->instance_1_versamento->getImportoVersamento(1));

        $this->assertEquals('10.00', $this->instance_2_versamento->getImportoVersamento(0));
        $this->assertEquals('22.00', $this->instance_2_versamento->getImportoVersamento(1));
        $this->assertNull($this->instance_2_versamento->getImportoVersamento(2));

        $this->assertEquals('16.00', $this->instance_1_2_bollo->getImportoVersamento(0));
        $this->assertEquals('34.00', $this->instance_1_2_bollo->getImportoVersamento(1));
        $this->assertNull($this->instance_1_2_bollo->getImportoVersamento(2));

    }

    #[TestDox('getImporto()')]
    public function testGetImporto()
    {
        $this->assertEquals('16.00', $this->instance_1_versamento->getImporto());
        $this->assertEquals('32.00', $this->instance_2_versamento->getImporto());
        $this->assertEquals('50.00', $this->instance_1_2_bollo->getImporto());

    }

    #[TestDox('isBollo()')]
    public function testIsBollo()
    {
        $this->assertFalse($this->instance_1_versamento->isBollo(0));
        $this->assertFalse($this->instance_1_versamento->isBollo(1));

        $this->assertFalse($this->instance_2_versamento->isBollo(0));
        $this->assertFalse($this->instance_2_versamento->isBollo(1));

        $this->assertTrue($this->instance_1_2_bollo->isBollo(0));
        $this->assertFalse($this->instance_1_2_bollo->isBollo(1));

    }

    #[TestDox('getEsito()')]
    public function testGetEsito()
    {
        $this->assertEquals('OK', $this->instance_1_versamento->getEsito());
        $this->assertEquals('OK', $this->instance_2_versamento->getEsito());
        $this->assertEquals('OK', $this->instance_1_2_bollo->getEsito());

    }

    #[TestDox('getIur()')]
    public function testGetIur()
    {
        $this->assertEquals('11111111111', $this->instance_1_versamento->getIur(0));
        $this->assertNull($this->instance_1_versamento->getIur(1));

        $this->assertEquals('22222222222', $this->instance_2_versamento->getIur(0));
        $this->assertEquals('22222222223', $this->instance_2_versamento->getIur(1));
        $this->assertNull($this->instance_2_versamento->getIur(2));

        $this->assertEquals('33333333333', $this->instance_1_2_bollo->getIur(0));
        $this->assertEquals('33333333334', $this->instance_1_2_bollo->getIur(1));
        $this->assertNull($this->instance_1_2_bollo->getIur(2));

    }
}
